import React, { useState, useEffect } from 'react';
import "./Map.css";
import GoogleMapReact from 'google-map-react';

export default function Map(props) {
    const [mapCenter, setMapCenter] = useState({ lat: 32.86867512568862, lng: -117.21368983643102 });
    const [mapZoom, setMapZoom] = useState(14);
    const [heatmapData, setHeatmapData] = React.useState([]);
    useEffect(() => {
        setHeatmapData(props.data);
    }, [props.data]);
    const position = props.data.map(d => ({ lat: d.lat, lng: d.lng }));
    console.log(position)

    return (
        <div className="Map" style={{ height: '100vh', width: '100%' }}>
            <GoogleMapReact
                bootstrapURLKeys={{ 
                    key: "AIzaSyCnasDuC3M7MHKCLlxqXU3vyJnzKAnwBTw",
                    libraries: ['visualization'] 
                }}
                defaultCenter={mapCenter}
                defaultZoom={mapZoom}
                // heatmap={heatmapData}
            >
            </GoogleMapReact>
        </div>
    )
}
